import React from "react";
import styles from "./NavBar.module.css";
import { NavLink } from "react-router-dom"

const NavLinkMe = ({ to, children, ...props }) => {
  return (
    <NavLink
      {...props}
      to={to}
      className={({ isActive }) => (isActive ? styles.active : styles.disable)}
    >
      {children}
    </NavLink>
  );
};

export default function Navbar() {
  return (
    <div className={styles.navbar}>
      <NavLinkMe to="/home" clas>Inicio</NavLinkMe>
      <NavLinkMe to="/sinopsis" clas>Sinopsis</NavLinkMe>
      <NavLinkMe to="/favorites" clas>Favoritos</NavLinkMe>
      <NavLinkMe to="/about" clas>Acerca de Mi</NavLinkMe>
    </div>
  );
}
